import axios from "axios";

export const getProductData = async (productDetailId) => {
  await axios
    .get(`http://bootcampapi.techcs.io/api/fe/v1/product/${productDetailId}`)
    .then((data) => setGetProduct(data.data))
    .catch((error) => console.log(error));
};
